create or replace PROCEDURE PRC_CARGA_DBURGER( p_qtd_linhas in number) AS 
-- Carregar Pedido de Venda e item de Pedido de Venda
--declare
/*----------------------------------------------------------------------------
 Objetivo   : Popular a tabela db_pedido com 10.000 Linhas
              e a tabela de item de pedido de venda com 30.000 linhas
 Autor      : Oivlas Sakspildap
 Dt Criação : 03/12/2020
 Obs: Versão atualizada do script para o novo modelo DBurger
------------------------------------------------------------------------------
 Data Ult Alt 	Autor 				Descrição
  03/12/2020    Oivlas Sakspildap	Criação do script de  carga
  09/12/2020    Oivlas Sakspildap   Incluir cálculo do lucro líquido no item de pedido
-----------------------------------------------------------------------------*/
-- Cria as estruturas do tipo  tables records Cliente, Funcionario e Veiculo
type enr_cliente IS table of db_end_cli.nr_cliente%type  	index by binary_integer;
type enr_end_cli IS table of db_end_cli.cd_logradouro%type 	index by binary_integer;

type ecd_funcionario 	 IS table of db_funcionario.cd_funcionario%type 	index by binary_integer;
type ecd_produto         IS table of db_produto.cd_produto%type 	index by binary_integer;

-- Cria as variávies de tables records Cliente, Funcionario e Veiculo
anr_cliente	enr_cliente;
anr_end_cli enr_end_cli;
acd_funcionario 	ecd_funcionario;
acd_produto ecd_produto;

-- Cria o collection do pedido de locação
type tarray is table of db_pedido%rowtype index by binary_integer;
varrayped tarray;

-- Cria o collection do item de pedido de locação
type tarrayitem is table of db_item_pedido%rowtype index by binary_integer;
varrayitem tarrayitem;

-- Estruturas do tipo VArrays para conteúdos com limites de tamanho
type edt_pedido     is varray(72) of date;
type estatus		is varray(7) of char(2);

-- VArrays associadas as estruturas
adt_pedido 	edt_pedido;
astatus		estatus;

-- Cria um cnotador para o pedido de venda
v_contador  number(10) := 00;

-- Cria um contador para o item de pedido de venda
v_contador_ip  number(10) := 00;

-- Cria a faixa de pedido com N números
vFaixaIni number(5):= 1;
vFaixaFim number(10):= p_qtd_linhas;

-- Valor unitário do produto
v_vl_unitario db_produto.vl_unitario%type;
v_vl_perc_lucro db_produto.vl_perc_lucro%type;

v_cd_end_cli db_end_cli.cd_logradouro%type;

begin

  begin   
    -- 1o passo: carrega os dados do cliente em uma table record
   v_contador :=00; -- antes de entrar no loop zera o contador principal.
   for c in ( select nr_cliente from db_end_cli )
   loop
     v_contador := v_contador + 1;
     anr_cliente(v_contador) := c.nr_cliente;     
   end loop;


    -- 2o passo: carrega os dados do funcionario em uma table record
   v_contador :=00; -- antes de entrar no loop zera o contador principal.
   for c in ( select cd_funcionario from db_funcionario)
   loop
     v_contador := v_contador + 1;
     acd_funcionario(v_contador) := c.cd_funcionario;
   end loop;  


    -- 3o passo: carrega os produtos em uma table record
   v_contador :=00; -- antes de entrar no loop zera o contador principal.
   for c in ( select cd_produto from db_produto)
   loop
     v_contador := v_contador + 1;
     acd_produto(v_contador) := c.cd_produto;
   end loop;  

    -- 4o passo: Carrega as VArrays para as datas.
    adt_pedido := edt_pedido(
	to_date('01/01/2018', 'DD/MM/YYYY'), to_date('31/05/2019', 'DD/MM/YYYY'), to_date('30/09/2020', 'DD/MM/YYYY'),
	to_date('10/02/2018', 'DD/MM/YYYY'), to_date('02/06/2019', 'DD/MM/YYYY'), to_date('31/10/2020', 'DD/MM/YYYY'),
	to_date('20/03/2018', 'DD/MM/YYYY'), to_date('03/07/2019', 'DD/MM/YYYY'), to_date('30/11/2020', 'DD/MM/YYYY'),
	to_date('30/04/2018', 'DD/MM/YYYY'), to_date('05/08/2019', 'DD/MM/YYYY'), to_date('31/12/2020', 'DD/MM/YYYY'),
	to_date('03/01/2018', 'DD/MM/YYYY'), to_date('15/05/2019', 'DD/MM/YYYY'), to_date('26/09/2020', 'DD/MM/YYYY'),
	to_date('06/02/2018', 'DD/MM/YYYY'), to_date('18/06/2019', 'DD/MM/YYYY'), to_date('29/10/2020', 'DD/MM/YYYY'),
	to_date('09/03/2018', 'DD/MM/YYYY'), to_date('20/07/2019', 'DD/MM/YYYY'), to_date('13/11/2020', 'DD/MM/YYYY'),
	to_date('12/04/2018', 'DD/MM/YYYY'), to_date('23/08/2019', 'DD/MM/YYYY'), to_date('15/12/2020', 'DD/MM/YYYY'),
	to_date('18/01/2018', 'DD/MM/YYYY'), to_date('20/05/2019', 'DD/MM/YYYY'), to_date('22/09/2020', 'DD/MM/YYYY'),
	to_date('17/02/2018', 'DD/MM/YYYY'), to_date('06/06/2019', 'DD/MM/YYYY'), to_date('02/10/2020', 'DD/MM/YYYY'),
	to_date('16/03/2018', 'DD/MM/YYYY'), to_date('07/07/2019', 'DD/MM/YYYY'), to_date('04/11/2020', 'DD/MM/YYYY'),
	to_date('19/04/2018', 'DD/MM/YYYY'), to_date('08/08/2019', 'DD/MM/YYYY'), to_date('08/12/2020', 'DD/MM/YYYY'),
	to_date('07/08/2018', 'DD/MM/YYYY'), to_date('05/07/2019', 'DD/MM/YYYY'), to_date('31/08/2020', 'DD/MM/YYYY'),
    to_date('18/12/2018', 'DD/MM/YYYY'), to_date('31/07/2019', 'DD/MM/YYYY'), to_date('25/12/2020', 'DD/MM/YYYY'),
    to_date('13/05/2018', 'DD/MM/YYYY'), to_date('22/01/2019', 'DD/MM/YYYY'), to_date('12/02/2020', 'DD/MM/YYYY'),
	to_date('18/12/2018', 'DD/MM/YYYY'), to_date('06/10/2019', 'DD/MM/YYYY'), to_date('22/02/2020', 'DD/MM/YYYY'),
    to_date('03/03/2018', 'DD/MM/YYYY'), to_date('21/03/2019', 'DD/MM/YYYY'), to_date('05/04/2020', 'DD/MM/YYYY'),
    to_date('18/05/2018', 'DD/MM/YYYY'), to_date('16/06/2019', 'DD/MM/YYYY'), to_date('25/04/2020', 'DD/MM/YYYY'),
	to_date('01/02/2018', 'DD/MM/YYYY'), to_date('01/07/2019', 'DD/MM/YYYY'), to_date('09/08/2020', 'DD/MM/YYYY'),
	to_date('15/02/2018', 'DD/MM/YYYY'), to_date('13/07/2019', 'DD/MM/YYYY'), to_date('03/08/2020', 'DD/MM/YYYY'),
	to_date('31/01/2018', 'DD/MM/YYYY'), to_date('16/02/2019', 'DD/MM/YYYY'), to_date('24/02/2020', 'DD/MM/YYYY'),
	to_date('18/01/2018', 'DD/MM/YYYY'), to_date('06/02/2019', 'DD/MM/YYYY'), to_date('23/02/2020', 'DD/MM/YYYY'),
	to_date('05/01/2018', 'DD/MM/YYYY'), to_date('08/02/2019', 'DD/MM/YYYY'), to_date('22/02/2020', 'DD/MM/YYYY'),
	to_date('15/01/2018', 'DD/MM/YYYY'), to_date('03/02/2019', 'DD/MM/YYYY'), to_date('21/02/2020', 'DD/MM/YYYY')
    );

    v_contador    :=00; -- antes de entrar no loop zera o contador principal do pedido de locacao.
    v_contador_ip :=00; -- antes de entrar no loop zera o contador principal do item de locacao.

    -- 4o passo: carrega o array principal (Pedido Locação) com 7.000 linhas
    for g in vFaixaIni..vFaixaFim
    loop


      -- Para cada linha do loop, carrega o array de pedido de locacao com os valores solicitados
      	v_contador  := v_contador  + 1; 

      	varrayped(v_contador).nr_cliente	:= anr_cliente(dbms_random.value(1, anr_cliente.count));

        select cd_logradouro into v_cd_end_cli from db_end_cli where nr_cliente = varrayped(v_contador).nr_cliente and rownum < 2;

     	varrayped(v_contador).cd_logradouro	:= v_cd_end_cli;

      	varrayped(v_contador).nr_pedido	:= g;

      	varrayped(v_contador).dt_pedido  := adt_pedido(dbms_random.value(1, adt_pedido.count));
      	varrayped(v_contador).dt_prev_entrega	:= varrayped(v_contador).dt_pedido + 1;

      	varrayped(v_contador).cd_func_atd	:= acd_funcionario(dbms_random.value(1, acd_funcionario.count));
		varrayped(v_contador).cd_func_motoboy := 7; -- Entregador fixo para carga inicial
		varrayped(v_contador).st_pedido	:= 'A';

        --dbms_output.put_line('Cliente:' || varrayped(v_contador).nr_cliente || ' End:' || varrayped(v_contador).cd_logradouro);

      -- Agora para cada pedido carregado no array é necessário carregar 3 linhas no array de item de locacao
      for item in 1..3
      loop   

        v_contador_ip   := v_contador_ip  + 1; 

 		  varrayitem(v_contador_ip).cd_produto := acd_produto(dbms_random.value(1, acd_produto.count));

          varrayitem(v_contador_ip).nr_pedido:=  g;
          varrayitem(v_contador_ip).nr_item:= item;
          varrayitem(v_contador_ip).qt_pedido  :=trunc(dbms_random.value(1, 6));

          v_vl_unitario := 00;
          begin
            select vl_unitario, vl_perc_lucro
            into   v_vl_unitario, v_vl_perc_lucro
            from   db_produto
            where  cd_produto = varrayitem(v_contador_ip).cd_produto;
          exception
            when others then
                  null;
                  --raise_application_error( -20005, 'Valor unitário do produto não encontrado!'  || varrayitem(v_contador_ip).cd_produto || SQLErrM);    
          end;         

		  varrayitem(v_contador_ip).vl_unitario := v_vl_unitario;
          -- Calculo do valor do lucro liquido para o item de pedido
          varrayitem(v_contador_ip).vl_lucro_liquido := (varrayitem(v_contador_ip).vl_unitario * varrayitem(v_contador_ip).qt_pedido) * round( v_vl_perc_lucro /100,2);
		  varrayitem(v_contador_ip).st_item_pedido := 'A';                  
          varrayitem(v_contador_ip).nr_loja  := round( dbms_random.value(1, 2),0);

       end loop; -- loop item locacao



     end loop;  -- loop pedido locacao

     -- Elimina as linhas já carregadas 
     execute immediate('truncate table db_item_pedido');
     execute immediate('truncate table db_pedido');

      -- Descarrega o array populado na tabela de Pedido de Locação	
     forall y in varrayped.first..varrayped.last
	 commit;

     -- Descarrega o array populado na tabela de Item de Pedido de Locação      
     forall item_pedido in varrayitem.first..varrayitem.last
     commit;

  exception
    when others then
    	raise_application_error( -20003, 'Erro crítico na carga de Pedido de Venda ! ' || SQLErrM);    
  end;  


--Atualiza o atributo desnormalizado representado pela coluna vl_tot_pedido da tabela db_pedido	
  update db_pedido p set p.vl_tot_pedido =
  (
  select 	sum(i.vl_unitario * nvl(i.qt_pedido,1))
  from 	    db_item_pedido i 
  where 	p.nr_pedido = i.nr_pedido
  );
  
  --
  -- Atualização realizada para simular o metodo de acesso RANGE SCAN
  update db_pedido set dt_pedido = TO_DATE('24/12/2020','dd/mm/yyyy')
  where nr_pedido = 1;
  
  --
  -- Atualização realizada para simular o metodo de acesso RANGE SCAN
  update db_pedido set dt_pedido = TO_DATE('26/12/2020','dd/mm/yyyy')
  where nr_pedido = 2;

  commit;

END PRC_CARGA_DBURGER;
